import React from 'react';
import HeaderButtonManager from '../components/HeaderButtonManager';
import FooterButtonManager from '../components/FooterButtonManager';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <HeaderButtonManager/>
      </header>
      <body>
      Body
      </body>
      <footer>
        <FooterButtonManager/>
      </footer>
    </div>
  );
}

export default App;
